import React, { useState, useEffect } from "react";
import { fetchPlan } from "./ApiCalls";
import { successModal, unsuccessModal } from "./Utility";

const Plan = () => {
  const [plans, setPlans] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [formData, setFormData] = useState({
    dates: "",
    category: "",
    plan: "",
  });
  const [showModal, setShowModal] = useState(false);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const plansData = await fetchPlans();
        setPlans(plansData);
      } catch (error) {
        setError(error.message);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await addPlan(formData);
      if (!response.ok) {
        throw new Error("Failed to add plan");
      }
      const data = await response.json();
      setPlans((prevPlans) => [...prevPlans, data]);
      setFormData({
        dates: "",
        category: "",
        plan: "",
      });
      successModal();
      setShowModal(false);
    } catch (error) {
      setError(error.message);
      unsuccessModal(error.message);
    }
  };

  const handleEditSubmit = async (e, planId) => {
    e.preventDefault();
    try {
      const response = await updatePlan(planId, formData);
      if (!response.ok) {
        throw new Error("Failed to update plan");
      }
      const updatedPlan = await response.json();
      setPlans((prevPlans) =>
        prevPlans.map((plan) =>
          plan.id === updatedPlan.id ? updatedPlan : plan
        )
      );
      successModal();
      setShowModal(false);
    } catch (error) {
      setError(error.message);
      unsuccessModal(error.message);
    }
  };

  if (loading) return <p>Loading...</p>;
  if (error) return <p>Error: {error}</p>;

  return (
    <div className="plan">
      <h2>Plan</h2>
      <button onClick={() => setShowModal(true)}>Add Plan</button>
      <form onSubmit={handleSubmit}>
        <label htmlFor="dates">Date:</label>
        <input
          type="date"
          name="dates"
          value={formData.dates}
          onChange={handleChange}
        />
        <label htmlFor="category">Category:</label>
        <input
          type="text"
          name="category"
          value={formData.category}
          onChange={handleChange}
        />
        <label htmlFor="plan">Plan:</label>
        <input
          type="text"
          name="plan"
          value={formData.plan}
          onChange={handleChange}
        />
        <button type="submit">Add Plan</button>
      </form>
      {/* Display plans */}
      <ul>
        {plans.map((plan) => (
          <li key={plan.id}>
            <p>Date: {plan.dates}</p>
            <p>Category: {plan.category}</p>
            <p>Plan: {plan.plan}</p>
            {/* Add edit/delete functionality here */}
          </li>
        ))}
      </ul>
      {/* Add modal for add/edit */}
      {showModal && (
        <div className="form-modal">
          <div className="form-modal-content">
            <div className="header">
              <h2>Add Plan</h2>
              <span className="close" onClick={() => setShowModal(false)}>
                &times;
              </span>
            </div>
            <form onSubmit={handleSubmit}>{/* Form fields */}</form>
          </div>
        </div>
      )}
    </div>
  );
};

export default Plan;
